import { setFileScope, endFileScope } from "@vanilla-extract/css/fileScope";
import { style } from "@vanilla-extract/css";
setFileScope("src/lib/components/MenuItem/useMenuItem.css.ts?used", "braid-design-system");
const menuItem = style({
  selectors: {
    [`&::-moz-focus-inner`]: {
      border: 0
    }
  }
}, "menuItem");
endFileScope();
export {
  menuItem
};
